import './App.css';
import {Registration} from "./components/registration"
import {Enter} from "./components/enter"
import {Home} from "./components/home"
import { Route, BrowserRouter } from 'react-router-dom';
import {ProductList} from "./components/productList";
import {ProductData} from "./components/productDatlies";
import {Mannager} from "./components/mannager";
import {GetUsersMannager} from "./components/userListMannager";
import {Basket} from "./components/basket";
import {Provider} from 'react-redux'
import {myStore} from "./store"

function App() {
  return (
    <div className="App">
       {/* <Registration></Registration>  
      <Enter></Enter> */}
      {/* <ProductList/>  */}
      <BrowserRouter> 

      <Home/>
      <Route path="/Register" component={Registration}></Route>
      <Route path="/Login" component={Enter}></Route>
      <Provider store={myStore}>
      <Route path="/productData" component={ProductData}></Route>
      <Route path="/products" component={ProductList}></Route>
      <Route path="/mannager" component={Mannager}></Route>
      <Route path="/users" component={GetUsersMannager}></Route>
      <Route path="/basket" component={Basket}></Route>
      </Provider>

      </BrowserRouter>
    </div>
  );
}

export default App;
